import { IconButton, List } from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
import { StyledListItemButton } from "../../styles/dashboard/DashboardAccordian";
import { MiddleDivider } from "../../styles/dashboard/DashboardSidebar";
import ProductionQuantityLimitsIcon from '@mui/icons-material/ProductionQuantityLimits';
import AddIcon from '@mui/icons-material/Add';
import PersonIcon from '@mui/icons-material/Person';
import EditIcon from '@mui/icons-material/Edit';
import { NavLink } from "react-router-dom";

export default function SidebarAccordian(){


return(
    <>
    <List>
        <StyledListItemButton LinkComponent={NavLink} 
        to="/dashboard"
        style={({ isActive }) => ({
          backgroundColor: isActive ? '#someColor' : 'transparent',
        })}><IconButton><DashboardIcon sx={{color:"#fff"}}/> </IconButton> Dashboard   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink}><IconButton><ProductionQuantityLimitsIcon sx={{color:"#fff"}}/> </IconButton> Products   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink}><IconButton><AddIcon sx={{color:"#fff"}}/> </IconButton> Add Products   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink}><IconButton><PersonIcon sx={{color:"#fff"}}/> </IconButton> Users   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink}><IconButton><EditIcon sx={{color:"#fff"}}/> </IconButton> Edit Data   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
    </List>
    </>
)

}
